import {
    precompileTemplate
} from "@ember/template-compilation";
export default precompileTemplate("{{#if this.tags}}\n  <div class=\"mini-tag-chooser-selected-collection selected-tags\">\n    {{#each this.tags as |tag|}}\n      <DButton @translatedTitle={{tag.value}} @icon=\"xmark\" @action={{fn (action this.selectKit.deselect) tag.value}} tabindex=\"0\" class={{tag.classNames}}>\n        {{discourse-tag tag.value noHref=true}}\n      </DButton>\n    {{/each}}\n  </div>\n{{/if}}", {
    moduleName: "select-kit/components/mini-tag-chooser/selected-collection.hbs"
});